// SPDX-License-Identifier: Apache 2
pragma solidity 0.8.19;
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "../structs/UnqWormholeStructs.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../interface/IWormhole.sol";
import "../Wormhole/WormholeUnq.sol";
import "./UnqEscrow.sol";

contract UnqTreasury is Initializable {
    bytes32 _solanaTreasury;
    bytes32 _treasuryAuthority;
    address _denominatedCurrency;
    WormholeUnq factory_contract;
    uint256 _platformFeePercentage;
    address _escrowAddress;
    address _platformFeeDestination;
    mapping(bytes32 => UnqWormholeStructs.MemberData) members;
    address _relayerSigner;
    mapping(address => uint256) memberDeposits;

    uint256 MULTIPLIER = 10000;

    constructor() {
        _disableInitializers();
    }

    modifier nonExistingMember(
        UnqWormholeStructs.AddMemberAction memory member
    ) {
        require(
            members[member.solanaAddress].solanaAddress == bytes32(0),
            "Member alredy in club!"
        );
        _;
    }

    modifier onlyAuthority(bytes32 authority) {
        require(authority == _treasuryAuthority, "Invalid permission");
        _;
    }

    modifier existingMember(bytes32 solanaAddress, address ethereumAddress) {
        require(
            members[solanaAddress].ethAddress == ethereumAddress,
            "Wrong Ethereum destination address!"
        );
        _;
    }

    modifier onlyTreasuryMembers(
        bytes32 senderSolanaAddress,
        address senderEthAddress,
        bytes32 receiverSolanaAddress,
        address receiverEthAddress
    ) {
        UnqWormholeStructs.MemberData memory sender = members[
            senderSolanaAddress
        ];

        require(
            sender.ethAddress == senderEthAddress,
            "Invalid ETH sender address"
        );

        UnqWormholeStructs.MemberData memory receiver = members[
            receiverSolanaAddress
        ];

        require(
            receiver.ethAddress == receiverEthAddress,
            "Invalid destination ETH address"
        );

        _;
    }

    modifier onlyRelayerSigner() {
        require(tx.origin == _relayerSigner, "Invalid authority call!");
        _;
    }

    modifier denominatedCurrencyRestrict() {
        require(
            _denominatedCurrency != address(0),
            "Invalid denominated currency!"
        );

        _;
    }

    event MemberAddedEvent(UnqWormholeStructs.MemberData);
    event DepositEvent(uint256);
    event WithdrawFundsEvent(uint256);
    event TransferFundsEvent(uint256);
    event TreasuryCreatedEvent(bytes32);
    event SharesBoughtEvent(UnqWormholeStructs.SharesBought);
    event ClaimFundsEvent(uint256);

    function initialize(
        bytes32 solanaTreasury,
        bytes32 treasuryAuthority,
        address denominatedCurrency,
        address factoryContract,
        address creator,
        address relayerSigner,
        address platformFeeDestination,
        uint256 platformFeePercentage
    ) external initializer {
        _solanaTreasury = solanaTreasury;

        _treasuryAuthority = treasuryAuthority;

        _denominatedCurrency = denominatedCurrency;

        factory_contract = WormholeUnq(factoryContract);

        _relayerSigner = relayerSigner;

        _platformFeeDestination = platformFeeDestination;

        _platformFeePercentage = platformFeePercentage;

        UnqEscrow escrowContract = new UnqEscrow(address(this));

        _escrowAddress = address(escrowContract);

        members[treasuryAuthority] = UnqWormholeStructs.MemberData({
            solanaAddress: treasuryAuthority,
            ethAddress: creator,
            status: UnqWormholeStructs.MemberStatus.Accepted,
            joinedAt: block.timestamp,
            solanaTreasury: _solanaTreasury
        });

        emit TreasuryCreatedEvent(solanaTreasury);
    }

    function addNewMember(
        UnqWormholeStructs.AddMemberAction memory newMember
    ) external nonExistingMember(newMember) onlyRelayerSigner {
        UnqWormholeStructs.MemberData memory memberData = UnqWormholeStructs
            .MemberData({
                solanaTreasury: _solanaTreasury,
                solanaAddress: newMember.solanaAddress,
                ethAddress: newMember.ethAddress,
                status: UnqWormholeStructs.MemberStatus.Accepted,
                joinedAt: block.timestamp
            });
        members[newMember.solanaAddress] = memberData;
        emit MemberAddedEvent(memberData);
    }

    function receiveFunds(
        bytes32 memberAddress,
        uint8 nonce
    ) external payable existingMember(memberAddress, msg.sender) {
        bytes memory vaaBytes = abi.encodePacked(
            uint8(0),
            _solanaTreasury,
            memberAddress,
            msg.value
        );
        factory_contract.pushWomrholeMessage(vaaBytes, nonce);
        require(
            members[memberAddress].status ==
                UnqWormholeStructs.MemberStatus.Accepted,
            "Not a member"
        );

        require(msg.value >= 1000000000 wei, "Invalid deposit amount");

        memberDeposits[tx.origin] += msg.value;

        transferFees(msg.value);

        emit DepositEvent(msg.value);
    }

    function getMemberData(
        bytes32 memberAddress
    ) public view returns (UnqWormholeStructs.MemberData memory) {
        return members[memberAddress];
    }

    function transferFunds(
        address payable destination,
        uint256 amount,
        address currency
    ) external onlyRelayerSigner {
        if (currency == address(0)) {
            destination.transfer(amount);
        } else {
            ERC20 denominatedToken = ERC20(currency);
            denominatedToken.transfer(destination, amount);
        }
        emit TransferFundsEvent(amount);
    }

    function withdrawFunds(
        bytes32 solanaAddress,
        address payable destination,
        uint256 amount,
        address currency
    ) external existingMember(solanaAddress, destination) onlyRelayerSigner {
        if (currency == address(0)) {
            destination.transfer(amount);
        } else {
            ERC20 token = ERC20(currency);
            token.transfer(destination, amount);
        }
        emit WithdrawFundsEvent(amount);
    }

    function sellFinancialRights(
        address payable receiver,
        bytes32 treasury,
        bytes32 financialOffer,
        bytes32 seller,
        bytes32 buyer
    ) public payable onlyTreasuryMembers(buyer, msg.sender, seller, receiver) {
        require(
            _denominatedCurrency == address(0),
            "Can't sell shares in native currency"
        );

        receiver.transfer(msg.value);

        require(msg.value >= 1000000000 wei, "Invalid sell shares amount");

        bytes memory encodedPayload = abi.encodePacked(
            uint8(1),
            treasury,
            buyer,
            financialOffer,
            seller,
            msg.value
        );

        factory_contract.pushWomrholeMessage(encodedPayload, 0);

        emit SharesBoughtEvent(
            UnqWormholeStructs.SharesBought({
                buyer: buyer,
                seller: seller,
                solanaTreasury: treasury,
                amount: msg.value
            })
        );
    }

    function claimFunds(
        bytes32 solanaAddress,
        address payable destination,
        uint256 amount,
        address currency
    ) public onlyRelayerSigner existingMember(solanaAddress, destination) {
        UnqEscrow escrow = UnqEscrow(payable(_escrowAddress));

        escrow.transferToMember(destination, currency, amount);

        emit ClaimFundsEvent(amount);
    }

    function sellSharesDenominatedCurrency(
        bytes32 sellerSolanaAddress,
        bytes32 buyerSolanaAddress,
        bytes32 treasury,
        address receiver,
        bytes32 financialOffer,
        uint256 amount
    ) public payable {
        require(
            _denominatedCurrency != address(0),
            "Treasury does not have denominated currency"
        );
        ERC20 token = ERC20(_denominatedCurrency);
        token.transferFrom(msg.sender, receiver, amount);
        bytes memory encodedVaa = abi.encodePacked(
            uint8(1),
            treasury,
            buyerSolanaAddress,
            financialOffer,
            sellerSolanaAddress,
            amount
        );
        factory_contract.pushWomrholeMessage(encodedVaa, 0);

        emit SharesBoughtEvent(
            UnqWormholeStructs.SharesBought({
                buyer: buyerSolanaAddress,
                seller: sellerSolanaAddress,
                solanaTreasury: treasury,
                amount: amount
            })
        );
    }

    function executeWithdrawal(
        address currency,
        uint256 amount
    ) public payable onlyRelayerSigner {
        if (currency == address(0)) {
            payable(_escrowAddress).transfer(amount);
        } else {
            ERC20 token = ERC20(currency);
            token.transfer(_escrowAddress, amount);
        }
    }

    function getEscrowAddress() public view returns (address) {
        return _escrowAddress;
    }

    function depositDenominatedCurrency(
        bytes32 solanaAddress,
        uint256 amount,
        uint8 nonce
    )
        public
        payable
        denominatedCurrencyRestrict
        existingMember(solanaAddress, msg.sender)
    {
        bytes memory vaaBytes = abi.encodePacked(
            uint8(0),
            _solanaTreasury,
            solanaAddress,
            amount
        );
        factory_contract.pushWomrholeMessage(vaaBytes, nonce);
        ERC20 token = ERC20(_denominatedCurrency);

        token.transferFrom(msg.sender, address(this), amount);

        transferFees(amount);

        memberDeposits[msg.sender] += amount;

        emit DepositEvent(amount);
    }

    function getDenominatedCurrency() public view returns (address) {
        return _denominatedCurrency;
    }

    function setPlatformFees(
        address payable destination,
        uint256 percentage
    ) external onlyRelayerSigner {
        if (percentage < 0 || percentage > 10000) {
            revert("Invalid percentage amount");
        }

        _platformFeeDestination = destination;
        _platformFeePercentage = percentage;
    }

    function calculatePercentageAmount(
        uint256 depositAmount
    ) private view returns (uint256 fee) {
        if (_platformFeePercentage == 0) return 0;

        fee =
            (depositAmount / MULTIPLIER) *
            ((_platformFeePercentage * MULTIPLIER) / 100);
    }

    function transferFees(uint256 depositAmount) public payable {
        uint256 feeAmount = calculatePercentageAmount(depositAmount);
        if (_denominatedCurrency != address(0)) {
            ERC20 token = ERC20(_denominatedCurrency);

            token.transfer(_platformFeeDestination, feeAmount);
        } else {
            payable(_platformFeeDestination).transfer(feeAmount);
        }
    }
}
